import { Component } from '@angular/core';
import { faLinkedin } from '@fortawesome/free-brands-svg-icons';
import{faFacebookF} from '@fortawesome/free-brands-svg-icons';

@Component({
  selector: 'app-right-nav',
  templateUrl: './right-nav.component.html',
  styleUrls: ['./right-nav.component.css']
})
export class RightNavComponent {

  faLinkedin=faLinkedin
  faFacebookF=faFacebookF
}
<ul class="navbar-nav all">
  <li class="nav-item active">
    <a class="nav-link" href="https://www.facebook.com/FranciMagliocca/" style="color: black;"><fa-icon [icon]="faFacebookF" width="100%"></fa-icon></a>
  </li>
  <li class="nav-item">
    <a class="nav-link" href="https://www.linkedin.com/in/francesco-magliocca/" style="color: black;"><fa-icon [icon]="faLinkedin" width="100%"></fa-icon></a>
  </li>
  <li class="nav-item">
    <a class="nav-link" href="https://www.instagram.com/francesco_magliocca_/" style="color: black;"><i class="fa fa-instagram"></i></a>
  </li>
  <li class="nav-item">
    <a class="nav-link " href="mailto:franci.magliocca@gmail.com" style="color: black;"><i class="fa fa-envelope"></i></a>
  </li>
</ul>
